import React from 'react';
import Counter from './Counter';
import DynamicContent from './DynamicContent';
import ToggleContent from './ToggleContent';


function App() {
  return (
    <div className="App">
      <Counter />
      <DynamicContent isLoggedIn = {true}/>
      <ToggleContent/>
    </div>
  );
}

export default App;
